	render(){

		return(
			<div>
				<div className='grid-figure-wrapAbout'>
					<div className='aboutContent'>
						Warner Bros. Records is one of the most successful recording companies in music history and home to some of the most influential and innovative artists of our time. Its reputation and extraordinary roster of new and established recording artists is unparalleled, and its collective influence on pop culture is without precedent. With a visionary approach toward discovering and nurturing musical talent, the Warner Bros. Records family of labels is currently home to an impressive generation of major artists. The Warner Bros. roster includes The Black Keys, Michael Bubl√©, Gary Clark Jr., Biffy Clyro, Jason Derulo, The Flaming Lips, Goo Goo Dolls, Green Day, Josh Groban, Jenny Lewis, Linkin Park, Mac Miller, Mastodon, Muse, Robert Plant, Prince, Red Hot Chili Peppers, Damien Rice, Regina Spektor, Tegan and Sara, Tom Petty and the Heartbreakers, Neil Young, and many others. The rich and diversified catalog on the Warner Bros. family of labels includes recordings by Black Sabbath, Miles Davis, Dire Straits, the Grateful Dead, the Kinks, Madonna, Randy Newman, the Ramones, Talking Heads, James Taylor, Frank Sinatra, Van Morrison, Van Halen and others.
					</div>
				</div>
			</div>
		)
	}
}

export default AboutLabel;
